INSERT INTO `itens` VALUES (1,'','R$ 2.899,99','\nAsus MD15 um dos menores notebooks de 15 polegadas do mundo\nSeja para trabalho ou lazer, o ASUS M515 é um notebook que oferece desempenho poderoso e visuais envolventes. Sua tela NanoEdge possui um revestimento antirreflexo fosco para uma experiência verdadeiramente envolvente. O M515 é equipado com até processador AMD Ryzen e memória de 8 GB. Armazenamento rápido com SSD com até 256GB PCIe SSD.\n\nMais velocidade no seu dia a dia\nO ASUS M515 possui armazenamento SSD, que além de ser muito mais rápido que o HD convencional, é menor, mais leve e não tem partes mecânicas extremamente sensíveis a impactos e solavancos. Isso garante maior proteção aos dados armazenados no seu notebook, para que você possa trabalhar sem preocupações, com alto desempenho e produtividade, mesmo em um veículo em movimento.\n\nRápido e eficiente\nCom processadores até SérioAMD Ryzen com 8 GB de memória, o ASUS M515 ajuda você a fazer as coisas com rapidez e eficiência.\n\nTenha uma visão mais ampla do mundo\nA tela NanoEdge dá ao ASUS M515 uma vasta área de tela para uma experiência de visualização envolvente seja para o trabalho ou lazer. Com tela FHD de visão ampla apresenta um revestimento antirreflexo para reduzir distrações indesejadas de reflexos irritantes, para que você possa realmente se concentrar no que está à sua frente.\n','Notebook Asus AMD Ryzen 5-3500U, 8GB RAM, SSD 256GB, 15,6\', Radeon Vega 8, Windows 11 Home, Cinza - M515DA-BR1213W',2,1),(2,'','R$ 1.999,00','\n\nSmartphone Samsung Galaxy S20 FE 5G 128GB\n \nEste é o smartphone para pessoas que querem tudo. Ouvimos vocês, os fãs, e agora não precisam mais ficar em dúvida sobre o que escolher. Este é o smartphone feito sob medida para fãs de todos os tipos. Então, se você é fã de fotografia, jogos ou adora deixar seu feed repleto de tudo que o inspira, nós reunimos a combinação definitiva de inovação S20. Este é o smartphone que oferece o que você deseja, para você fazer mais daquilo que ama.\n\nA Câmera de Lente Tripla de Nível Profissional\nA câmera de lente tripla de nível profissional permite que você tire aquela foto profissional digna de #semfiltro com facilidade. Enquadre a cena com a câmera wide e, a seguir, mostre ainda mais com a câmera ultra-wide, ou aumente o zoom com o zoom óptico de 3x na câmera teleobjetiva.\n\nConectividade\nO LTE de até 1,6 Gbps oferece velocidades de dados poderosas, enquanto o Wi-Fi 6 conecta você com segurança e baixa latência, mesmo em um local lotado. Portanto, quer você esteja conectado a LTE ou Wi-Fi, pode jogar em tempo real com pouco atraso.\n\nBateria Inteligente o Dia Todo para que Você possa Jogar por Horas\nViva sua vida sem se preocupar com onde você pode conectar seu smartphone. A bateria de 4500mAh (padrão) dá ao seu smartphone a energia necessária para durar mais que o seu dia, e é inteligente o suficiente para economizar energia para quando você realmente precisar.\n \nEspaço para Milhares de Fotos e Vídeos\nCom 128 GB integrados e a capacidade de armazenar até 1 TB (não incluso) a mais em um cartão microSD, o único limite para o que você pode armazenar é o que você pode criar e baixar.\n\n','Smartphone Samsung Galaxy S20 FE 5G, 6GB RAM, Snapdragon 865, 128GB, Octa Core, Câmera Tripla 32MP, Tela Infinita 6.5, Azul Marinho - SM-G781BZBRZTO',3,1),(3,'','R$ 1.299,99','A TGC12 ThunderX3 é uma cadeira gamer com revestimento de Poliuretano (PU) coberta com costuras de fibra de carbono. Seu estofado é em forma de diamantes construída com firmeza para proporcionar conforto enquanto você desfruta do prazer de jogar seus games favoritos. Da sala de estar para a sala de jogos, você pode planejar a próxima dominação do mundo do conforto de sua cadeira gamer.','Cadeira Gamer ThunderX3 TGC12, Black',5,1),(4,'','R$ 4.499,90','\nConsole Sony Playstation 5\n \nJogar no PS5 Não Tem Limites\nDesfrute do carregamento do seu PS5, extremamente rápido com o SSD de altíssima velocidade, uma imersão mais profunda com suporte a feedback tátil, gatilhos adaptáveis e áudio 3D, além de uma geração inédita de jogos incríveis para PlayStation.\n\nVeloz como um raio, SSD ultrarrápido\nDomine o poder de uma CPU e GPU personalizadas e o SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\n\nMaximize suas sessões de jogo com tempo de carregamento praticamente instantâneo para jogos do PS5 instalados.\n\nJogos impressionantes para PS5\nMaravilhe-se com os gráficos incríveis e experimente os recursos do novo PS5. \'Ray Tracing\' (Rastreamento de raios) Mergulhe em mundos com um nível inédito de realismo enquanto os raios de luz são simulados individualmente, criando sombras e reflexos realistas em jogos compatíveis com Playstation 5. Jogos para TVs 4K Curta seus jogos favoritos do PS5 na sua incrível TV 4K. Até 120 fps com saída em 120 Hz Desfrute da fluidez e taxa de quadros de até 120 fps em jogos compatíveis, com suporte a saída de 120 Hz em telas 4K.\n\nTecnologia HDR\nCom uma TV HDR, os jogos compatíveis do PS5 exibem uma variedade de cores inacreditavelmente vibrantes e realistas. Saída em 8K Os consoles PS5 oferecem suporte à saída 8K, para que você possa jogar na sua tela com resolução de 4320p.\n\nTempest 3D AudioTech\nMergulhe em palcos sonoros que farão você acreditar que os sons estão vindo de todas as direções. Seja com seus fones de ouvido ou os alto-falantes de sua TV, seu ambiente ganhará vida com o Tempest 3D AudioTech em jogos compatíveis.\n\nResposta tátil\nExperimente a resposta tátil com o controle sem fio DualSense em jogos selecionados do PS5 e sinta o impacto de suas ações no jogo através da resposta sensorial dinâmica.\n\nGatilhos adaptáveis\nAssuma o controle com os imersivos gatilhos adaptáveis, agora com níveis dinâmicos de resistência que simulam o impacto físico das atividades em jogos selecionados do PS5.\n\n','Console Sony Playstation 5',4,1),(5,'','R$ 179,99','\nHeadset Gamer HyperX Cloud Stinger\n \nFaça parte da família Cloud da HyperX com o headset Cloud Stinger!\nCompleta e versátil, a linha de headsets Cloud foi projetada para as necessidades de qualquer nível de jogador. Independente do seu sistema, estilo de jogo e características este headset irá te surpreender. O Cloud Stinger é um modelo licenciado oficialmente pela Xbox, perfeito para jogadores de Xbox One! Conforto, tecnologia e design a sua altura.\n\nHyperX confortável para todo tipo de rosto\nOs fones de ouvido giram 90° e ficam bem apoiados confortavelmente em torno do pescoço durante os intervalos de batalhas. Como todo headset HyperX, possui a tecnologia premiada da espuma memory foam. Além do conforto, a qualidade do som é impecável! Este modelo possui drivers de 50mm que oferecem qualidade de som impecáveis com precisão de áudio e garantindo sua imersão no jogo. Ainda para seu conforto possui controles em aço de alta qualidade são projetados para longa durabilidade e estabilidade, se ajustando perfeitamente.\n\nSom imersivo para você se sentir no jogo com o Headset HyperX\nPossui também controle deslizante de volume para sua comodidade. Ele está localizado na parte inferior do fone de ouvido direito. Seu microfone tem cancelamento de ruído que gira para ser silenciado. Também com ruído passivo integrado que reduz o ruído de fundo para uma melhor qualidade de voz em seus jogos multiplayer. Um dos seus diferenciais também é sua leveza, um headset leve e com toda a tecnologia que você precisa.\n','Headset Gamer HyperX Cloud Stinger, Drivers 50mm, Múltiplas Plataformas, P2 e P3 - HX-HSCS-BK/NA',7,1),(6,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10ª Geração oferecem atualizações de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimização de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que você faz, direcionando potência dinamicamente para onde ela é mais necessária. Os processadores Intel Core da 10ª Geração com memória Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10ª Geração oferecem conectividade cabeada e sem fio rápida, garantida e versátil.\n\nEntretenimento premium \nUma nova arquitetura de gráficos oferece suporte a experiências visuais ultravívidas, como vídeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10 ª Geração com gráficos Intel Iris Plus permitem experiências de entretenimento nunca vistas.\n\nJogos sérios (serious gaming) \nAproveite jogos incríveis com alto FPS, até mesmo enquanto realiza streaming e gravação. Turbo e aceleração da memória Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10ª Geração capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vídeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6,1),(7,'','R$ 1.089,99','\nProcessador Intel Core i5-10400 \nOs novos processadores Intel Core da 10ª Geração oferecem atualizações de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, Intel Wi-Fi 6 (Gig) tecnologia, HDR 4K, otimização de sistema inteligentes e muito mais. \n\nProdutividade acelerada \nRecursos de desempenho inteligente integrados aprendem e se adaptam ao que você faz, direcionando potência dinamicamente para onde ela é mais necessária. Os processadores Intel Core da 10ª Geração com memória Intel Optane fornecem a responsividade para fazer mais.\n\nA melhor conectividade da categoria \nCom Intel Wi-Fi 6 (Gig+) e tecnologia Thunderbolt 3 integrados, os processadores Intel Core da 10ª Geração oferecem conectividade cabeada e sem fio rápida, garantida e versátil.\n\nEntretenimento premium \nUma nova arquitetura de gráficos oferece suporte a experiências visuais ultravívidas, como vídeo em HDR 4K e jogos a 1080p. Os processadores Intel Core da 10 ª Geração com gráficos Intel Iris Plus permitem experiências de entretenimento nunca vistas.\n\nJogos sérios (serious gaming) \nAproveite jogos incríveis com alto FPS, até mesmo enquanto realiza streaming e gravação. Turbo e aceleração da memória Intel Optane. Em casa ou em qualquer lugar, processadores Intel Core da 10ª Geração capazes de overclocking rodam as plataformas definitivas de jogos em notebooks e desktops.\n\nPossui Vídeo Integrado \n','Processador Intel Core i5-10400, 2.9GHz (4.3GHz Max Turbo), Cache 12MB, LGA 1200 - BX8070110400',6,1),(9,'\\n','R$ 4.499,99','\nPC Gamer Concórdia 32732\n \nEscolhemos um Gabinete Gamer com design bonito e arrojado com frontal com iluminação RGB que certamente trará mais evidência para o seu setup. O PC Gamer Concórdia vem equipado com um poderoso processador Intel Core i5 de 10° Geração que oferece atualizações de desempenho incríveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nCuidadosamente pensado para jogadores de alto nível, o PC Gamer Concórdia possui uma GTX 1650 de 4GB, que fornece um desempenho  para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto é velocidade, seu SSD de 480GB certamente dará conta do recado, armazene e acesse à todos os seus arquivos e programas em um piscar de olhos. \n','PC Gamer Concórdia Processador Core i5-10400F, RGB, Geforce GTX1650, 8GB, SSD 480GB, Preto - 32726',1,1),(10,'\\n','R$ 3.362,48','Fácil Computadores - Com 30 anos de excelência atuando no Brasil, criamos soluções completas na área de informática. Nossos computadores são equipados com os mais recentes processadores de alta velocidade, maximizando sua produção.\n','Pc Gamer Fácil, Intel Core I7, 16GB, Ssd 480GB, Gtx 1050ti, 4GB - Fonte 500w',1,0),(11,'','R$ 4.299,99','\nPC Gamer Concórdia AMD Ryzen 5 4500\n \nConfiguração Incrível Focada Em Colecionar Vitórias\nO PC Gamer Concórdia AMD Ryzen 5 4500, possui fonte Concórdia 500w Real, 80 Plus Bronze, automática com PFC ativo, não é o máximo?! Por ser GeForce GTX 1650, possui uma configuração incrível, que é extremamente focada em colecionar vitórias, a linha de PC Gamer Concórdia AMD Ryzen, é ideal para quem busca desempenho, velocidade e qualidade de imagem em seus jogos!\nSetup Maravilhoso\nConta com componentes potentes, desde a fonte até o processador, esse sem dúvida é o arsenal que você precisa para conquistar o universo dos games e deixar seu setup maravilhoso! O PC Gamer Concórdia AMD Ryzen garante velocidade e armazenamento, para maior agilidade em tudo o que fizer!\n','PC Gamer Concórdia AMD Ryzen 5 4500, ARGB, GeForce GTX 1650, 16GB RAM, SSD 480GB, Linux, Preto - 33647',1,0),(12,'\\n','R$ 10.999,99','\nPC Gamer Concórdia 32732\n \n\nEscolhemos um Gabinete Gamer com design bonito e arrojado que certamente trará mais evidência para o seu setup. O PC Gamer Concórdia vem equipado com um poderoso processador Intel Core i7 de 10° Geração que proporciona até 2,5 vezes mais desempenho.\n\nCuidadosamente pensado para jogadores de alto nível, o PC Gamer Concórdia possui uma RTX 3060 de 12GB, desempenho além do limite para qualquer tarefa ou jogos mais recentes.\n\nQuando o assunto é velocidade seu SSD de 500GB com tecnologia NVme certamente dá conta do recado, armazene e acesse à todos os seus arquivos e programas em um piscar de olhos. \n\n','PC Gamer Concórdia Core i7-10700F, Geforce RTX3060 12GB, 16GB RAM, SSD 500GB, Branco - 32736',1,0),(13,'\n\\n\n','R$ 2.999,99','\nPC Gamer Skul 3000 I3-10100F, Radeon RX 550, 8GB DDR4, SSD 240GB, 500W PFC ATIVO, Linux \nCom Memória RAM 8GB DDR4 uma configuração focada em colecionar vitórias, a linha de computadores Gamer é ideal para quem busca desempenho, velocidade e qualidade de imagem em seus jogos!\n \nComponentes Potentes\nO PC Gamer Skul 3000 conta com um processador i3 de 10ª Geração. Com componentes potentes, desde a fonte até o processador e a placa de vídeo RX 550 4GB, esse sem dúvida é o arsenal que você precisa para conquistar o universo dos games.\n\nVelocidade e Potência\nO PC Gamer ainda conta com um SSD 240GB SATA garantindo velocidade e armazenamento, para maior velocidade, o PC ainda conta com Linux. \n\n','PC Gamer Skul 3000 I3-10100F, Radeon RX 550, 8GB DDR4, SSD 240GB, 500W PFC ATIVO, Linux - G4704-120630',1,0),(14,'\\n\n','R$ 10.999,99','\nPC Gamer Acer Predator Orion 5000 Intel Core i7-11700, RGB, NVIDIA GeForce RTX3070, 16GB RAM, SSD 1TB, Windows 11 Home, Preto\n\nProcessador de 11° Geração\nO novo Desktop Predator Orion chegou para romper barreiras e te levar para um mundo novo dentro do universo gamer. Com processador Intel Core 11° Gen e placa NVIDIA GeForce RTX, jogos, vídeos e softwares rodam leves como uma pena em níveis nunca experimentado antes.\n\nDesbrave os Ambientes Mais Inusitados\nCom placa NVIDIA GeForce 3070 com 8 GB GDDR6 e processador Intel Core i7 Octa Core, o Predator Orion entrega gráficos perfeitos, imagens surreais e jogabilidade fluída, que roda seus jogos favoritos com excelente resolução e riqueza de detalhes, como se fosse uma realidade paralela. O escolhido para viver essa realidade foi você!\n\nGuarde suas Memórias dessa Batalha Alucinante\nTudo que você vivenciar com o Orion poderá ser guardado com folga. O desktop da Predator conta com 1 TB de armazenamento SSD. Além disso, você chegará a novos destinos em alta velocidade, graças à memória RAM de 16 GB.\n\nUm Mundo Novo de Cores só Seu\nA tecnologia ARGB permite brincar com cores e tons, deixando seu setup com a coloração que você desejar. Misture as cores, use sua imaginação e criatividade e construa seu mundo de cores personalizadas.\n\n','PC Gamer Acer Predator Orion 5000 Intel Core i7-11700, RGB, NVIDIA GeForce RTX3070, 16GB RAM, SSD 1TB, Windows 11 Home, Preto - DG.E2QAL.006',1,0),(15,'\\n\n','R$ 2.299,99','\n\n','PC Gamer Concórdia AMD Ryzen 3-3200G, RGB, 8GB DDR4, SSD 240GB, Linux, Preto - 31723',1,0),(16,'\\n\n','R$ 2.992,88','\nNossos computadores são equipados com os mais recentes processadores de alta velocidade, maximizando sua produção\n\n','PC Gamer Completo Fácil Intel I5 Terceira Geração, 16GB, GT 420 4GB, SSD 240GB, Monitor 19',1,0),(17,'\\n\n','R$ 2.999,99','\nPC Gamer Fácil AMD Ryzen 5-5600G, RGB, 16GB RAM, SSD 512GB, Linux, Preto - 18343\nFácil Computadores - Com 30 anos de excelência atuando no Brasil, criamos soluções completas na área de informática. Nossos computadores são equipados com os mais recentes processadores de alta velocidade, maximizando sua produção.\n\nCOMPUTADOR MONTADO E CONFIGURADO\n\nGabinete Gamer Black com Lateral Transparente. Mais estilo e durabilidade, para seu Setup Gamer nunca te deixar para trás nas batalhas!\nPainel RGB na parte Frontal do Gabinete. Botão seletor com 13 modos de cor RGB!\n\n','PC Gamer Fácil AMD Ryzen 5-5600G, RGB, 16GB RAM, SSD 512GB, Linux, Preto - 18343',1,0),(18,'\\n\n','R$ 5.999,99','\nPC Gamer On Gaming Powered By Asus i5 10400F, RTX 3050 8GB, 16GB, SSD M.2 480GB, ONG104D0516M52, Linux\n\nCom componentes dos Melhores Fabricantes de Ti do Brasil. Alto Desempenho, Performance, Durabilidade e Sutileza Estética.\n\nExcelente Setup para você que quer ter acesso a gráficos mais exigentes. Com o processador i5 10400F de décima geração da Intel, com a placa de vídeo dedicada RTX 3050 8GB, e 16GB de memória Ram, você terá acesso a jogos com gráficos mais elaborados, atingindo excelente fluidez em jogos e projetos.\n\n','PC Gamer On Gaming Powered By Asus i5 10400F, RTX 3050 8GB, 16GB, SSD M.2 480GB, ONG104D0516M52, Linux - ONG104D0516M52',1,0),(19,'\\n\n','R$ 8.999,99','\nPC Gamer Concórdia Intel Core i7-10700F, Memória 16GB, SSD 500 NVME, Placa de Vídeo RTX 3060 12GB Ghost\n \nProcessamento Ultraveloz\nO Computador Concórdia Avalanche Preto, vem equipado com processador Intel Core i7-10700F com 8 Núcleos e 16 Threads e Frequência de 4.80hz no modo Turbo, Placa Mãe Asus H510m-e, 16GB de Memoria Corsair Vengeance LPX 8Gb 2666MHz DDR4, com esses hardwares você irá ter potência no seu gameplay e também nas suas tarefas do dia-a-dia, atualizações de desempenho incríveis para melhorar a produtividade, proporcionando entretenimento surpreendente.\n\nVelocidade e Potência\nO Computador Gamer da Concórdia conta com SSD de 500GB NVME, garantindo velocidade e armazenamento, ainda conta com a Placa de Vídeo RTX 3060 12GB Ghost que irá garantir melhor desempenho em jogos como League of Legends, Valorant, Fortnite, Rainbow Six e CS:GO e os jogos mais recentes.\n\nEstabilidade e Confiabilidade\nO Computador é equipado com uma Fonte de alimentação de 600W reais com 80 Plus Bronze e PFC Ativo, que traz energia estável para não ter nenhum problema enquanto joga. \n\n','PC Gamer Concórdia i7-10700F, Geforce RTX 3060 12GB, 16GB RAM, SSD 500, Avalanche Preto - 33292',1,0);
INSERT INTO `itens` VALUES (20,'\\n\n','R$ 3.268,32','\nPC Gamer Fácil Intel Core I5 10400f 10a Geração, 16GB DDR4, NVIDIA GEFORCE GT 420 4GB, SSD 480GB, Fonte 500W\n\n','PC Gamer Fácil Intel Core I5 10400f 10a Geração, 16GB DDR4, NVIDIA GEFORCE GT 420 4GB, SSD 480GB, Fonte 500W',1,0),(21,'\\n\n','R$ 1.091,55','\nSmartphone Motorola Moto G20, 128GB, 4G, Octa-Core, 4GB RAM, Câmera Quádrupla, Verde + Capa Protetora \n\nDê vida a jogos, filmes e videochamadas com a tela Max Vision HD+ de 6,5 polegadas. E com uma taxa de 90 Hz no Smartphone Moto G20, o lag dá lugar a uma visualização mais fluida e um desempenho muito mais suave\n\nQuad Câmera com Sensor de 48 MP + Night Vision\n\nCom o sistema Quad Câmera com sensor de 48 MP do smartphone moto G20, você tira fotos nítidas e vibrantes com pouca luz ou até à noite, além de retratos lindos com fundo desfocado e imagens bem de perto com um nível de detalhes surpreendente.\n\nSuperbateria com Mais de Dois Dias de Duração\n\nO smartphone moto G20 possui bateria de 5000 mAh, o que proporciona mais de dois dias de duração a cada recarga. Com ela, você pode ouvir músicas por 122 horas, assistir a vídeos por 11,6 horas ou navegar na internet por 18,3 horas. Tudo isso com uma única carga.\n\n','Smartphone Motorola Moto G20, 128GB, 4G, Octa-Core, 4GB RAM, Câmera Quádrupla, Verde + Capa Protetora - PANG0055BR',3,0),(22,'\\n\n','R$ 1.649,00','\nSmartphone Motorola Moto G71, 5G, 6GB RAM, 128GB, Câmera Tripla 50MP, Octa Core, Tela 6.4, Verde \n \nDesempenho Mais Rápido Smartphone Potente\nPrepare-se para a próxima geração de tecnologia 5G com o moto g71 5G. O processador Snapdragon 695 e os 6 GB de RAM têm a velocidade que você precisa para se conectar ao 5G.\n\nCarregamento Surreal com a Bateria de 5000Mah\nCom o carregamento TurboPower 30, a bateria carrega rápido. São 5000 mAh para você fazer tudo que quiser por 30 horas. \n\nCores Vibrantes Na Tela OLED Full HD+ de 6,4\"\nAssista as suas séries e filmes favoritos na tela brilhante que eles merecem. A tela Max Vision de 6,4″ tem a tecnologia OLED para produzir imagens cristalinas e pretos mais escuros com brilho e contraste impressionantes.\n\nSistema de câmera tripla com sensor de 50 MP\nDeixe seus cliques mais nítidos com pouca luz, tire fotos ultra-wide com grande-angular, faça retratos com aparência profissional e capture detalhes bem de perto. Você tem a câmera ideal para todos os momentos.\n','Smartphone Motorola Moto G71, 5G, 6GB RAM, 128GB, Câmera Tripla 50MP, Octa Core, Tela 6.4, Verde - PAS20017BR',3,0),(23,'\\n\n','R$ 809,00','\nSamsung Galaxy A03\n \nConheça o novo Galaxy Galaxy A03 da Samsung! Com 64GB de memória, é ideal para as tarefas do dia a dia.\n\nPossui uma execelente bateria de 5000mAh, permitindo que você gaste seu tempo com o que mais gosta e se preocupe menos com a vida útil da bateria.\n \nAlcance uma ótima qualidade de imagem com as Câmeras duplas do Galaxy A03. Filme, fotografe, e registre os principais momentos da sua vida.\n','Smartphone Samsung Galaxy A03, 4GB RAM, Octa Core, Câmera Dupla 48MP, Tela Infinita 6.5, Preto - SM-A035MZKSZTO',3,0),(24,'\\n\n','R$ 999,00','\nSmartphone Motorola Moto G20\n \nQuad Câmera com Sensor de 48 MP + Night Vision\n \nCom o sistema Quad Câmera com sensor de 48 MP¹ do smartphone moto g20, você tira fotos nítidas e vibrantes com pouca luz ou até à noite, além de retratos lindos com fundo desfocado e imagens bem de perto com um nível de detalhes surpreendente. \n\nTela Max Vision de 6,5\"\" e 90 Hz\n\nDê vida a jogos, filmes e vídeo chamadas com a tela Max Vision HD+ de 6,5\"\". E com uma taxa de 90 Hz no smartphone moto G20, o lag dá lugar a uma visualização mais fluida e um desempenho muito mais suave.\n\nSuperbateria com mais de dois dias de duração\n\nO smartphone moto g20 possui bateria de 5000 mAh, o que proporciona mais de dois dias de duração a cada recarga. Com ela, você pode ouvir músicas por 122 horas, assistir a vídeos por 11,6 horas ou navegar na internet por 18,3 horas. Tudo isso com uma única carga.\n\n','Smartphone Motorola G20, 64GB, Octa-Core, Câmera Quadrupla, 48MP, Capa Protetora, Grafite - XT212',3,0),(25,'\\n\n','R$ 939,00','\nSmartphone Motorola Moto E40, 64GB, 4GB RAM, Octa Core, Câmera 48MP, Grafite \n \nTire fotos mais claras e nítidas, retratos com efeito profissional e imagens com um nível de detalhes surpreendente. É a câmera perfeita para todos os ângulos e momentos, até quando a luz não ajuda.\n\nDesempenho 38% Mais Rápido - 64 GB e 4GB de RAM\n \nO processador octa-core customizado turbina os gráficos em 38%. É velocidade de sobra para jogar, assistir a vídeos ou registrar a noitada com os amigos. E com 4 GB de RAM da última geração, nunca foi tão simples fazer tudo ao mesmo tempo.\n\nMais de 40 Horas de Bateria\n\nCom a bateria reforçada de 5000 mAh, você passa muito mais tempo longe da tomada a cada recarga. Ouça música por 76 horas. Assista a vídeos por 14 horas. Ou navegue na internet por 10 horas. Pode esquecer o carregador. O moto e40 não deixa você na mão.\n\n','Smartphone Motorola Moto E40, 64GB, 4GB RAM, Octa Core, Câmera 48MP, Grafite - PARJ0014BR',3,0),(26,'\\n\n','R$ 2.906,05','\nSmartphone Motorola Moto Edge 20 Pro, 256GB, 5G, 12GB RAM, Octa Core, 108MP, Tela 6.7, Capa Protetora, Azul \n\nABUSE DE IMAGENS FENOMENAIS COM 108 MP\n\nCapture imagens extremamente nítidas em pouca luz usando a câmera de alta resolução de 108 MP com a tecnologia Ultra Pixel. Grave vídeos em 8K, a maior resolução possível em um smartphone. Não perca o foco em longas distâncias com o Super Zoom de 50x. \n\nDESCUBRA A TELA OLED COM 144 Hz\n\nVeja mais de um bilhão de tonalidades vibrantes na incrível tela OLED e assista a séries e filmes do seu serviço de streaming favorito na telona que eles merecem. Graças à taxa de atualização extremamente rápida de 144 Hz, o lag dá lugar a uma visualização super fluida. \n\nCONECTIVIDADE MULTITELAS DA PLATAFORMA READY FOR\n\nSeu smartphone tem potência de sobra. Por isso, criamos o Ready For¹, que amplifica tudo que há de melhor no seu telefone. É só conectar, com ou sem fio, e pronto. Veja seus jogos de celular na telona para curtir muito mais a experiência.\n\n','Smartphone Motorola Moto Edge 20 Pro, 256GB, 5G, 12GB RAM, Octa Core, 108MP, Tela 6.7, Capa Protetora, Azul - XT2153-1',3,0),(27,'\\n\n','R$ 1.099,00','\nSmartphone Motorola  Moto G31, 128GB, 4GB RAM, Octa Core, Câmera Tripla 50MP, Tela 6.4, Azul \n \nCores Surreais\n\nImagens mais nítidas e vibrantes em uma tela OLED Full HD+ de 6.4 polegadas.\nCom a resolução Full HD+, os vídeos e fotos não ficam pixelados, e você vê todos os detalhes com muito mais nitidez.\n\nCâmera tripla com sensor de 50 MP\n\nGrandes momentos nos mínimos detalhes. Possui tecnologia night vision que permite resultados incríveis incríveis mesmo no escuro. \n\nVocê irá notar a grande diferença que o modo proporciona aos seus cliques noturnos. Surpreenda-se com fotos nitidas, otima claridade e cores vibrantes.\nAgora, é só se divertir com esse sistema de câmeras incrível.\n\nBateria de Longa Duração\n \nO Motorola Moto G31 conta com uma bateria de 5000MAh, ou seja muito mais tempo pra ficar conectado e ligado em tudo. \nPara a Motorola um bom celular é aquele que você precisa carregar apenas à noite, após um dia inteiro de uso e que garanta performance necessária para você realizar todas as suas tarefas, por isso o Moto G31 é ideal, com 5000MAh você tem bateria o dia todo.\n\n','Smartphone Motorola Moto G31, 128GB, 4GB RAM, Octa Core, Câmera Tripla 50MP, Tela 6.4, Azul - PASK0036BR',3,0),(28,'\n\\n\n','R$ 1.099,00','\nSmartphone Samsung Galaxy M13 128GB Azul\n \nBateria que dura o dia todo\nCom bateria de 5.000 MAh, o Samsung Galaxy M13 é um smartphone Android completo sem nada a invejar nos dispositivos mais avançados. Com uma boa memória interna de 128GB com possibilidade de expansão de até 1TB. Seu acabamento na cor azul dá mais estilo ao seu novo smartphone.\n \nÓtimas fotos com seu Galaxy M13\nGraças à câmera de 50 megapixels, o Galaxy M13 tira ótimas fotos em 8165x6124 pixels e em alta resolução (Full HD) para gravar vídeo com uma resolução de 1920x1080 pixels. Muito fino, possui uma espessura de 8,4 mm que torna o Galaxy M13 uma boa escolha para seu próximo smartphone.\n\nTela Infinita com reconhecimento facial\nSurpreendentemente,o M13 possui tela sensível ao toque de 6,6 polegadas. Para desbloquear o seu Smartphone captura através da câmera, o seu rosto em profundidade por meio de mais de 30.000 pontos invisíveis para obter o mapa facial 3D preciso e distinto. Desta forma, qualquer tipo de movimento do seu rosto não impedirá o dispositivo de detectá-lo antes de desbloqueá-lo.\n\nProcessador octa-core\nO processador é a peça do smartphone que garante a velocidade em tudo que você fizer nele. O Smartphone Samsung Galaxy M13 possui um processador octa-core de até 2 GHz e memória RAM de 4 GB. Entre os recursos, o Galaxy M13 tem conectividade LTE, Wi-Fi 5, Bluetooth 5.0, NFC, bandeja dupla para chip SIM, entrada para fones de ouvido P2 e porta USB-C. O celular usa a interface One UI Core 4.1 baseada no Android 12.\n\n','Smartphone Samsung Galaxy M13, 4GB RAM, 128GB, Octa Core, Câmera Tripla 50MP, Tela Infinita 6.6, Azul - SM-M135MLBSZTO',3,0),(29,'\n\\n\n','R$ 1.994,05','\nSmartphone Motorola Moto Edge 20, 128GB, 5G, 8GB RAM, 108MP, Tela 6.7, Capa Protetora, Preto\n \nO Primeiro 5G com Design Ultrafino do Brasil\nCom uma estrutura única em liga de alumínio, o motorola edge 20 é ultraleve, mas super-resistente. Ele cabe fácil no bolso ou na bolsa. Com apenas 6,99 mm, é um dos aparelhos mais finos no mercado e o smartphone 5G mais fino que já produzimos.\n\nCâmera de 108MP e Super Zoom de 30X\nPrepare-se para qualquer momento, seja de longe ou bem de perto. Registre imagens mais nítidas em situações de pouca luz com uma câmera principal avançada de 108 MP e tecnologia Ultra Pixel. Grave vídeos com definição incrível em 4K. Não perca o foco em longas distâncias com o Super Zoom de 30x.\n\nTela OLED com 144 Hz \nVeja mais de um bilhão de tonalidades vibrantes na tela Max Vision de 6,7\" com HDR10+ e tecnologia OLED, que produz imagens cristalinas e pretos mais escuros. Graças à taxa de atualização extremamente rápida de 144 Hz, o lag dá lugar a uma visualização superfluida para que você assista a séries e filmes do seu serviço de streaming favorito na telona que eles merecem.\n\n','Smartphone Motorola Moto Edge 20, 128GB, 5G, 8GB RAM, 108MP, Tela 6.7, Capa Protetora, Preto - XT2143-1',3,0),(30,'\n\\n\n','R$ 1.199,00','\nSmartphone Samsung Galaxy A22\n \nTela incrível, rolagem realmente suave\n \nExpanda sua visão para o Infinity-U Display de 6,4 polegadas no Galaxy A22 e veja o que você está perdendo. Graças à tela HD+ Super AMOLED e 600 nits para maior clareza, seu conteúdo diário fica mais nítido e surpreendente. Além disso, sua taxa de atualização de 90Hz permite conteúdos mais suaves e realistas. O design elegante do Galaxy A22 confere um aspecto moderno e atraente. As curvas refinadas o tornam confortável de segurar e oferecem fácil navegação. \n\nEscolha como fotografar com a câmera quádrupla\n \nTransforme sua galeria em um tesouro de fotos criativas tiradas por você. A câmera quádrupla do Galaxy A22 eleva sua fotografia a um outro patamar, graças às quatro câmeras que capturam momentos incríveis de quatro maneiras diferentes. Diga adeus às fotos e vídeos embaçados. Com a Câmera Principal de 48MP com OIS (Estabilização Ótica de Imagem), você grava vídeos suaves, e captura mais luz para fotos nítidas mesmo em ambientes escuros. Semelhante à visão humana, a Câmera Ultra Wide de 8MP vê o mundo por um ângulo de visão de 123 graus, adicionando mais perspectiva a tudo o que você fotografa. Aproxime-se coma Câmera Macro de 2MP e capture detalhes vívidos. O efeito natural bokeh destaca o objeto fotografado de fundo. A Câmera de Profundidade de 2MP permite ajustar a profundidade de campo em suas fotos. Ajuste o desfoque do fundo para retratos de alta qualidade que destacam o objeto principal.\n\nBateria, Memória e Design Absurda\n\nAproveite o seu dia com uma bateria que não te deixa na mão. A bateria de 5.000 mAh permite que você mantenha suas atividades por muitas horas. E com até 15W de carregamento rápido, o Galaxy A22 volta rapidamente à carga total. O A22 combina potência de processamento Octa-core com até 4 GB de memória RAM para um desempenho rápido e eficiente. Desfrute de 128GB de armazenamento interno e expansível até 1TB a mais com cartão MicroSD\n\nConcentre-se mais com o One UI Core\n\nO One UI Core ajuda você a se concentrar no que importa. O hardware e o software trabalham juntos, com conteúdo e recursos na ponta dos dedos para que você possa acessá-los mais rapidamente. Troque aplicativos sem interrupções e veja vários conteúdos de uma só vez com o design conveniente que permite executar várias tarefas em uma única tela.\n\nSeu Samsung Galaxy você encontra aqui no KaBuM!\n\nO One UI Core ajuda você a se concentrar no que importa. O hardware e o software trabalham juntos, com conteúdo e recursos na ponta dos dedos para que você possa acessá-los mais rapidamente. Troque aplicativos sem interrupções e veja vários conteúdos de uma só vez com o design conveniente que permite executar várias tarefas em uma única tela.\n\n','Smartphone Samsung Galaxy A22, 128GB, 4GB RAM, Octa-Core, Camêra Quadrupla + Selfie 13MP, Tela Infinita 6.4, 5000mAh, Preto - SM-A225MZKRZTO',3,0);
INSERT INTO `itens` VALUES (31,'\n\\n\n','R$ 1.124,10','\n\nSmartphone Motorola Moto G22, 4GB RAM, 128GB, Octa Core, Câmera Quadrupla 50mp, Tela Max Vision 6.5, Preto \n\nVeja sua visão ganhar vida com o moto G22  \nCom o sistema Quad Câmera com sensor de 50 MP do smartphone moto g2, tire fotos nítidas e vibrantes com pouca luz ou até à noite, além de lindos retratos com fundo desfocado e imagens bem de perto com um nível de detalhes surpreendente.\n\nSistema de câmera quádrupla de 50 MP\nCapture imagens mais nítidas com pouca luz, ultra grande angular fotos, retratos com aparência profissional e close-ups incrivelmente detalhados.\n\nVida útil da bateria inacreditável \nVá mais longe com uma bateria de 5000 mAh de longa duração e deixe as preocupações de energia para trás.\n\nVisor Max Vision de 6,5\" 90 Hz\nDê vida a jogos, filmes e videochamadas com a tela Max Vision HD+ de 6,5\". E com uma taxa de 90 Hz no smartphone moto g22, o lag dá lugar a uma visualização mais fluida e um desempenho muito mais suave.\n\n','Smartphone Motorola Moto G22, 4GB RAM, 128GB, Octa Core, Câmera Quadrupla 50mp, Tela Max Vision 6.5, Preto - PATU0004BR',3,0),(32,'\n\\n\n','R$ 3.499,99','\n\nNotebook Acer Aspire 5 Intel Core i5-10210U, GeForce MX 250, 8GB RAM, 512GB SSD NVMe, 15.6 IPS FHD, Windows 11 Home, Prata - A515-54G-52FY\n\nOs notebooks da linha Aspire 5 são convenientemente portáteis e elegantes para acompanhar suas tarefas do dia a dia. Os recursos tecnológicos de sua confiança ao seu lado sempre que precisar. Desempenho suficiente para todas as tarefas, com Processador Intel Core 10ª geração. Você cria, edita, compartilha e assiste vídeos, fotos e imagens sem dificuldades.\n\nPodutividade é a Palavra-Chave!\nCom 8 GB de memória Ram, você não perde tempo, nem fluxo ao editar suas fotos, vídeos e projetos pesados. Com toda essa memória, seus jogos também ficam mais fluídos e realistas! Viva o significado de agilidade!\n\nA potência da 10ª Geração\n\nOs novos processadores Intel Core da 10ª Geração oferecem atualização de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, incluindo até 4.20Ghz, otimização de sistema inteligente e muito mais.\n\n','Notebook Acer Aspire 5 Intel Core i5-10210U, GeForce MX 250, 8GB RAM, 512GB SSD NVMe, 15.6 IPS FHD, Windows 11 Home, Prata - A515-54G-52FY',2,0),(33,'\n\\n\n','R$ 5.449,00','\n\nNotebook Gamer Acer Nitro 5 AN517-52-77KZ, Intel Core I7, 8GB, 512GB SSD, GTX 1650, 17.3\", Windows 11 Home.\n\n','Notebook Gamer Acer Nitro 5, Intel Core I7, 8GB, 512GB SSD, GTX 1650, 17.3\", Windows 11 Home - AN517-52-77KZ',2,0),(34,'\n\\n\n','R$ 13.499,99','\n\nNão importa se você está jogando por lazer ou em uma disputa acirrada: graças à jogabilidade mais fluida, você nunca perde nenhum detalhe essencial. Resultado de cuidadosas decisões de engenharia, o mais recente m15, com tela de 165 Hz, é incrivelmente rápido\n\nDê descanso aos seus olhos: A tela do m15 R6 inclui nossa tecnologia ComfortView Plus de baixa emissão de luz azul. Esta é uma abordagem baseada em hardware para filtrar a luz azul sem prejudicar a qualidade da imagem, projetada para proporcionar a você confiança para jogar por horas. O Alienware m15 R6 foi projetado para oferecer variedade. Sejam quais forem suas necessidades nos jogos, este notebook foi pensado não só para atender às suas necessidades, mas para superá-las, pois eleva o padrão das tecnologias de tela.\n\nA rapidez é indiscutível: O mais recente m15 R6 vem com uma taxa de atualização incrivelmente alta, de 165 Hz, e resolução FHD (1.920 x 1.080) para gerar todas as vezes imagens brilhantes e experiências gamers inesquecíveis. Nossa taxa de atualização mais alta: Disponível na resolução FHD, tem a taxa de atualização perfeita para uma jogabilidade competitiva, em que seus reflexos podem acompanhar a ação de alta velocidade graças a recursos gráficos excelentes a opção decisiva para a vitória decisiva.\n\nPara nós, o design é mais do que simples mecânica: é arte. A tecnologia de refrigeração Cryo-Tech da Alienware é uma abordagem de engenharia que não compromete o desempenho dos jogos por meio de métodos elétricos e mecânicos. Pelo contrário, ela mantém a estabilidade do sistema até mesmo durante os momentos mais intensos do jogo. O que há melhor em fluxo de ar: Nosso novo chassi m15 R6 prioriza o desempenho com um design de dual fan que extrai o ar frio das ventoinhas inferiores e superiores e faz a exaustão pela traseira, pela direita e pela esquerda, proporcionando a refrigeração ideal dos principais componentes. \n\n','Notebook Gamer Dell Alienware m15 R6 Intel Core i7-11800H, GeForce RTX 3070, 16GB RAM, SSD 1TB, 15.6 FHD 165Hz, Win 11, Preto - AW15-i1100-A30P',2,0),(35,'\n\\n\n','R$ 4.699,99','\nNotebook Gamer Ideapad Gaming 3i Intel Core i7-10750H, GTX 1650, 8GB RAM, 512GB SSD, Tela 15.6 FHD WVA, Linux, Chameleon Blue\n\nLenovo ideapad Gaming 3i\nNovo design com 10ª Geração de Processadores Intel Core i7-10750H e placa de vídeo NVIDIA GeForce GTX 1650 4GB. Ideal para gamers e usuários que também precisam de alta performance.\n\nTela Full HD\nCom tela de 15.6\'\' Full HD WVA Antirreflexo para melhor definição de imagem e cores. O armanezamento SSD PCIe NVMe é 10x mais rápido* que um HDD 2.5” SATA, você terá mais segurança ao armazenar seus dados. \n\nTeclado retroiluminado\nO teclado retroiluminado em LED azul, deixa o computador mais atraente e também favorece a performance para jogos em lugares com pouca iluminação.\n\nResfriamento\n\nSilencioso e não esquenta: projetado com um sistema de resfriamento otimizado composto por 2 coolers e 4 saídas de ar para suportar o alto desempenho do notebook.\n\nWebcam com Privacidade\nSua privacidade pessoal é muito importante. É por isso que o Ideapad Gaming 3i está equipado com prática porta de privacidade da webcam. Quando não estiver em uma chamada de vídeo ou gravando algo, basta deslizá-la. \n\nBateria Longa\nCom até 9.6 horas de duração de bateria o Ideapad Gaming 3i permite que você jogue por muito mais tempo. Além de possuir a tecnologia de carregamento rápido: quinze minutos de carregamento garante até duas horas de uso**. \n\nAltamente resistente\nA Lenovo coloca o Ideapad Gaming 3i à prova em testes de resistência altamente estressantes como: altas e baixas temperaturas, choque de temperatura, quebra e vibração, certificando a preocupação com a segurança e qualidade. Por meio de testes militares, mantém a convicção da melhor escolha sempre. \n\nRapidez e Agilidade\nA distância entre a tecla e o botão ficou menor: apenas 1.5mm. Tenha mais agilidade, rapidez e tempo de resposta. A função Q Control permite que o usuário da Lenovo mude a engrenagem simplesmente pressionando as teclas Fn + Q.\n\nPerformance para FPS\nMude do Modo Performance para maior FPS, altere do Modo Silencioso para melhor duração da bateria, ou use o Modo Balanceado para uso diário. Armazenamento híbrido: Possui 2 slots SSD M.2 e 1 slot HDD SATA.\n\n','Notebook Gamer Lenovo 3i Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, SSD 512GB, Tela 15.6 Full HD WVA, Linux, Chameleon Blue - 82CGS00200',2,0),(36,'\n\\n\n','R$ 3.999,99','\n\nNotebook Gamer Lenovo Gaming 3i Intel Core i5-10300H\n \nO Notebook Gamer com melhor performance\nNotebook Gamer Lenovo Gaming 3i novo design com 10 Geração de Processadores Intel Core i5-10300H e placa de vídeo NVIDIA GeForce GTX 1650 4GB, ideal para gamers e usuários que também precisam de alta performance Com tela de 15.6\'\' Full HD WVA Antirreflexo para melhor definição de imagem e cores. O armazenamento SSD PCIe NVMe é 10x mais rápido que um HDD 2.5” SATA, você terá mais segurança ao armazenar seus dados. \n\nDesign eficiente para melhor desempenho\nO teclado retroiluminado em LED azul, deixa o computador mais atraente e também favorece a performance para jogos em lugares com pouca iluminação. Silencioso e não esquenta: projetado com um sistema de resfriamento otimizado composto por 2 coolers e 4 saídas de ar para suportar o alto desempenho do notebook. Sua privacidade pessoal é muito importante. É por isso que o Ideapad Gaming 3i está equipado com prática porta de privacidade da webcam. Quando não estiver em uma chamada de vídeo ou gravando algo, basta deslizá-la. \n\nIdeapad bateria que dura e te permite jogar mais\nCom até 9.6 horas de duração de bateria o Ideapad Gaming 3i permite que você jogue por muito mais tempo. Além de possuir a tecnologia de carregamento rápido: quinze minutos de carregamento garante até duas horas de uso. A Lenovo coloca o Ideapad Gaming 3i à prova em testes de resistência altamente estressantes como: altas e baixas temperaturas, choque térmico, quebra e vibração, certificando a preocupação com a segurança e qualidade. Através de testes militares, mantém a convicção da melhor escolha sempre. \n\n','Notebook Gamer Lenovo IdeaPad Gaming 3i Intel Core i5-10300H, GeForce GTX 1650, 8GB RAM, SSD 256GB, Tela 15.6 FHD, Linux, Azul - 82CGS00100',2,0),(37,'\\n\n','R$ 3.799,99','\nNotebook Acer Aspire 5 Intel Core i7-10510U, 8GB RAM, 512GB SSD NVMe, Tela 15.6 IPS Full HD, Windows 11 Home, Prata - A515-54-74F9\n\nOs notebooks da linha Aspire 5 são convenientemente portáteis e elegantes para acompanhar suas tarefas do dia a dia. Os recursos tecnológicos de sua confiança ao seu lado sempre que precisar. Desempenho suficiente para todas as tarefas, com Processador Intel Core 10ª geração. Você cria, edita, compartilha e assiste vídeos, fotos e imagens sem dificuldades.\n\nPodutividade é a Palavra-Chave!\nCom 8 GB de memória Ram, você não perde tempo, nem fluxo ao editar suas fotos, vídeos e projetos pesados. Com toda essa memória, seus jogos também ficam mais fluídos e realistas! Viva o significado de agilidade!\n\nA potência da 10ª Geração\n\nOs novos processadores Intel Core da 10ª Geração oferecem atualização de desempenho incríveis para melhorar a produtividade e proporcionar entretenimento surpreendente, incluindo até 4.90Ghz, otimização de sistema inteligente e muito mais.\n\n','Notebook Acer Aspire 5 Intel Core i7-10510U, 8GB RAM, 512GB SSD NVMe, Tela 15.6 IPS Full HD, Windows 11 Home, Prata - A515-54-74F9',2,0),(38,'\\n\n','R$ 5.999,99','\n\nNotebook Gamer Acer Nitro 5 AMD Ryzen 7-4800H\n \nAtualize Seus Conceitos De Potência Brutal\nUm trem expresso direto para o centro da ação está chegando. O notebook gamer Acer Aspire Nitro 5 é a nova geração, com uma configuração que não treme para os jogos mais pesados. Embarque agora e prepare-se para a potência máxima.\n\nMergulhe de Cabeça na Ação\nA super placa de vídeo NVIDIA GeForce GTX 1650 com 4 GB de memória dedicada GDDR6 traz a performance que você precisa para surpreender seus adversários e jogar com alto nível de realismo.\n\nProcessamento que Impõe Respeito\nSe é poder que você quer para chegar mais rápido ao level avançado, conte com o desempenho do Processador AMD Ryzen 7 4800H, além dos 16 GB de memória tipo DDR4, expansível até 32 GB.\n\nEspaço de Sobra e Muito Veloz\nO Acer Aspire Nitro 5 vem equipado com 256 GB SSD M.2 NVMe + 1 TB HDD, o que promove alta velocidade de leitura e gravação. Com seu sistema operacional e jogos instalados nele, tudo abrirá em poucos segundos!\n\nO Seu Campo de Visão Ficou Mais Nítido\nA tela de 15,6” IPS Full HD transforma a sua experiência e te faz mergulhar de verdade na ação. O recurso IPS permite que você enxergue bem o jogo até dos ângulos mais complicados.\n\n','Notebook Gamer Acer Nitro 5 AMD Ryzen 7-4800H, GeForce GTX 1650, 16GB RAM, SSD 256GB NVMe, HDD 1TB, 15.6 FHD 144Hz, Linux - AN515-44-R4C8',2,0),(39,'\\n\n','R$ 3.799,99','\n\nNotebook Samsung Intel Core i5-1135G7, 8GB RAM, SSD 256GB, 15.6 Full HD, Windows 11 Pro, Cinza\n \nO Samsung Book possui uma arquitetura de última geração e design elegante para quem busca qualidade, desempenho e proteção do investimento. Conta com portas de acesso à memória e unidade de armazenamento, facilitando o upgrade e proporcionando mais longevidade ao sistema. A familia Samsung Books traz uma variedade de configurações, atendendo aos mais diversos perfis de utilização, seja para estudo, trabalho ou uso geral.\n\n','Notebook Samsung Intel Core i5-1135G7, 8GB RAM, SSD 256GB, 15.6 Full HD, Windows 11 Pro, Cinza - NP550XDA-KH6BR',2,0),(40,'\\n\n','R$ 5.399,99','\nNotebook Gamer Acer Nitro 5 Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, 512GB SSD, 15.6 IPS FHD, Win 11 Home, Preto - AN515-55-79X0\n \nAtualize seus conceitos de Potência Brutal\n\nUm trem expresso direto para o centro da ação está chegando. O notebook gamer Acer Aspire Nitro 5 é a nova geração, com uma configuração que não treme para os jogos mais pesados. Embarque agora e prepare-se para a potência máxima.\n\nSistema Operacional Windows 11\n\nO Windows 11 conta com ferramentas de fácil utilização que lhe permitem otimizar o espaço de trabalho e maximizar a produtividade. \n\nDesfrute dos jogos mais recentes com gráficos incrivelmente realistas. Jogue com amigos no console. Jogue com os seu acessórios favoritos. No que toca ao jogar à sua maneira, pode contar com o Windows 11\n\nNVIDIA GeForce GTX 1650 com 4 GB de memória dedicada GDDR6\n\nA GeForce GTX 1650 foi desenvolvida com o desempenho gráfico inovador da premiada arquitetura NVIDIA Turing. Ela é a potência definitiva para os games atuais mais populares e oferece ainda mais velocidade para os títulos modernos. Jogue melhor com a GeForce GTX\n\n','Notebook Gamer Acer Nitro 5 Intel Core i7-10750H, GeForce GTX 1650, 8GB RAM, SSD 512GB, 15.6 Full HD IPS 144Hz, Win11 - AN515-55-79X0',2,0),(41,'\\n\n','R$ 1.849,99','\nNotebook Lenovo Ultrafino IdeaPad 3i \n \nLenovo IdeaPad 3i possui design leve e compacto. Com  tela antirreflexo de 15.6\" para mais conforto visual, é o Notebook ideal para todos os momentos.\n\nConta com WiFi AC ultrarrápido e teclado numérico para trabalhar com mais agilidade nas suas planilhas.\n\nO armanezamento SSD PCIe é 10x mais rápido* que um HDD 2.5” SATA, você terá mais segurança ao armazenar seus dados. Nitidez e alta qualidade de som com certificação Dolby Audio.\n\nSua privacidade pessoal é muito importante. É por isso que o IdeaPad 3i está equipado com porta de privacidade da webcam.\n\nQuando não estiver em uma chamada de vídeo ou gravando algo, basta deslizá-la. Faça vídeo-conferências em alta-definição com a câmera HD-720p.\n\nCom base na velocidade de leitura dos dados obtidos através de spec de dados de leitura mb/s. \n\n','Notebook Lenovo IdeaPad 3i Intel Celeron N4020 Dual Core, 4GB, SSD 128GB, Windows 11, 15.6, Prata - 82BU0006BR',2,0),(42,'\\n\n','R$ 1.899,99','\nNotebook Acer Aspire 3 Intel Celeron N4020, 4GB RAM, SSD 128GB NVMe, Tela 15,6\', Intel UHD Graphic 600, Windows 11 Home, Preto\n \nDando Conta em Grande Estilo \nDesenvolvido para não deixar você parar, o Aspire 3 tem a tecnologia que acompanha seu estilo de vida. Equipado com o processador Intel Celeron N4020 Serie N, estudar, trabalhar e se divertir ficam mais fáceis.\n\nAgora com Windows 11\nO Aspire 3 vem equipado com o sistema operacional Windows 11 que entrega um visual mais moderno e intuitivo, além de oferecer os mais diversos benefícios ao seu notebook.\n\nEspaço e Velocidade \nCom SSD 128 GB, você pode ler e gravar arquivos muito mais rápido do que em um HD tradicional. Após poucos segundos da inicialização do sistema operacional, você já tem acesso completo às funcionalidades do seu notebook.\n\nImagens Impressionantes\nAssistir vídeos, filmes e séries será como estar no cinema com a tela de 15.6” HD (1366 x 768). A tecnologia Acer ComfyView™ otimiza o conforto, refletindo menos luz e garantindo uma visualização mais confortável.\n\nBateria que Não te Deixa na Mão\nO Aspire 3 foi feito para aguentar todas as necessidades do dia. Dependendo do uso, sua bateria pode durar até 9 horas*, permitindo que você complete todas as suas tarefas!\n\nSinta o Poder da Conexão\nA tecnologia Wireless 802.11a/b/g/n/ac permite uma conexão bem mais rápida que as tecnologias sem fio tradicionais. Com entrada HDMI 2.0, portas USB 2.0, USB 3.2 e Ethernet (RJ-45), você tem diversas opções para estar sempre conectado recebendo e distribuindo informação.\n\n\n','Notebook Acer Aspire 3 Intel Celeron N4020, 4GB RAM, SSD 128GB NVMe, Tela 15,6, Intel UHD Graphic 600, Windows 11 Home, Preto - A315-34-C9WH',2,0),(43,'\\n\n','R$ 4.549,99','\nConsole Sony Playstation 5 + Horizon Forbidden West\n \nConsole Playstation5\nO console PS5™ oferece novas possibilidades de jogabilidade que você nunca imaginou.\nReproduza jogos para PS5 e PS4 em Blu-ray Disc. Além disso, você também pode baixar jogos digitais para PS5 e PS4 pela PlayStation Store.\nExperimente o carregamento extremamente rápido do SSD de ultra-velocidade, uma imersão mais profunda com suporte à resposta tátil, gatilhos adaptáveis e áudio 3D. Além de uma geração totalmente nova de jogos incríveis PlayStation.\nNa velocidade da luz: Domine o poder das CPU e GPU personalizadas e do SSD com E/S integradas que redefinem as regras do que o console PlayStation pode fazer.\nJogos deslumbrantes: Maravilhe-se com os gráficos incríveis e experimente os recursos do novo PS5.\nImersão de tirar o fôlego: Descubra uma experiência de jogos ainda mais profunda com a ajuda da resposta tátil, dos gatilhos adaptáveis e da tecnologia de áudio 3D.\n\nHorizon Forbidden West\nExplore terras distantes, enfrente máquinas maiores e mais imponentes, e encontre novas tribos incríveis ao retornar para o futuro distante e pós-apocalíptico de Horizon.\n\nA terra está morrendo! Tempestades implacáveis e uma praga incontrolável devastam o que sobrou da humanidade enquanto máquinas assustadoras vagam por territórios próximos. A vida na Terra segue rumo à outra extinção, e ninguém sabe o porquê.\n\nCabe a Aloy descobrir os segredos por trás dessas ameaças e restaurar a ordem e equilíbrio ao mundo. Ao longo do caminho, ela reencontrará velhos amigos, forjará alianças com novas facções e descobrirá o legado do passado antigo enquanto tenta se manter um passo à frente de um novo inimigo.\n\n','Console Sony Playstation 5 + Horizon Forbidden West',4,0),(44,'\\n\n','R$ 449,90','\nSinta o feedback fisicamente responsivo às suas ações no jogo com atuadores duplos que substituem os motores tradicionais. Em suas mãos, essas vibrações dinâmicas podem simular a sensação de tudo, desde ambientes até o recuo de diferentes armas. Experimente vários níveis de força e tensão conforme você interage com o equipamento e os ambientes do jogo. Desde puxar a corda do arco cada vez mais tensa até pisar no freio em um carro em alta velocidade, sinta-se fisicamente conectado às suas ações na tela. Converse com amigos online usando o microfone embutido - ou conectando um fone de ouvido ao conector de 3,5 mm. Ligue e desligue facilmente a captura de voz a qualquer momento com o botão dedicado para silenciar. Capture e transmita seus momentos de jogo mais épicos com o botão criar. Com base no sucesso do botão pioneiro SHARE, criar oferece aos jogadores mais maneiras de produzir conteúdo de jogos e transmitir suas aventuras ao vivo para o mundo.\n\n','Controle Sem fio PS5 DualSense',4,0),(45,'\\n\n','R$ 2.095,20','\nO Console Xbox Série S 512GB SSD é menor e mais elegante de todos os tempos. Com taxas de quadros mais altas, tempos de carregamento mais rápidos e mundos mais ricos e dinâmicos, o Xbox Series S da Microsoft oferece desempenho e velocidade de última geração em um formato compacto e totalmente digital. Retrocompatibilidade com milhares de jogos. Prepare-se para tempos de carregamento mais rápidos, resolução mais alta, taxas de quadros mais estáveis e melhor latência de entrada em milhares de jogos Xbox One, Xbox 360 e Xbox Original.\n\n','Console Xbox, Serie S, SSD 512GB, Branco, Bivolt - RRS-00006.',4,0),(46,'\\n\n','R$ 449,99','\nExperimente o design moderno do Controle Sem Fio Pulse Red, com superfícies esculpidas e geometria refinada para melhorar o conforto durante os jogos com uma duração da bateria de até 40 horas Mantenha-se focado com um direcional híbrido e aderência texturizada nos gatilhos, botões e tampa do compartimento de pilhas. Capture e compartilhe conteúdo de forma simplificada, como capturas de tela, gravações e muito mais com o novo botão de Compartilhamento. Conecte-se usando a entrada USB-C para conectar e jogar diretamente no console ou PC. O suporte para as pilhas AA está incluído no tampa do compartimento de pilhas. Use o aplicativo Acessórios do Xbox para remapear botões e criar perfis de controle personalizados para seus jogos favoritos. Conecte qualquer fone de ouvido compatível com o conector de fone de ouvido estéreo de áudio de 3,5mm. Emparelhe rapidamente, jogue e alterne entre dispositivos, incluídos o Xbox Series X|S, Xbox One, PC com Windows 10 e Android. A compatibilidade com iOS estará disponível no futuro.\n\n','Controle Sem Fio Xbox Pulse Red - QAU-00066',4,0),(47,'\\n\n','R$ 4.499,99','\nApresentamos o Xbox Series X, o console mais rápido e poderoso de todos os tempos. Jogue milhares de títulos de quatro gerações de consoles- todos os jogos têm melhor aparência e são melhor executados no Xbox Series X. No coração do Series X está a Xbox Velocity Architecture, que combina um SSD personalizado e software integrado para diminuir significativamente os tempos de carregamento dentro e fora do jogo. Troque simultaneamente entre vários jogos em um instante com o Quick Resume. Explore novos mundos e desfrute da ação como nunca antes com 12 teraflops incomparáveis de poder de processamento gráfico. Desfrute de jogos 4K a até 120 quadros por segundo, som 3D avançado especial e muito mais. Comece com uma biblioteca instantânea de mais de 100 jogos de alta qualidade, incluindo todos os novos títulos do Xbox Game Studios no mesmo dia do seu lançamento como o Halo Infinite, com o Xbox Game Pass Ultimate (assinatura vendida separadamente).\n','Console Microsoft Xbox Series X, 1TB, Preto - RRT-00006',4,0),(48,'\\n\n','R$ 2.816,00','\nO novo sistema Nintendo Switch foi projetado para apresentar uma tela OLED vibrante de 7 polegadas para cores vivas e contraste nítido, onde quer que você esteja a jogar, dispõe de amplo suporte ajustável para desfrutar de ângulo adequado, bem como um dock com porta LAN com fio e 64gb de capacidade de armazenamento interno, sendo uma parte reservada para uso pelo sistema e a outra para salvar seus jogos favoritos, além de áudio aprimorado.\n\n','Console Nintendo Switch Oled - Branco',4,0),(49,'\\n\n','R$ 2.199,99','\nNintendo Switch 32GB, 1x Joycon\n \nPara jogar muito\nConsole Nintendo Switch O console que lhe permite jogar os jogos que quiser, onde e como quiser. Inclui o console Nintendo Switch e a base do Nintendo Switch na cor preta, contrastando com os controles Joy-Con direito\n\ne esquerdo, um vermelho e o outro azul. Também inclui tudo o que você precisa para começar a jogar. Três modos em um só Switch. O Nintendo Switch foi desenvolvido para fazer parte da sua vida, transformando-se de um console doméstico em um console portátil num piscar de olhos. Coloque o seu Nintendo Switch na base do console para se divertir jogando em sua televisão. Abra o suporte para compartilhar a tela – e a diversão – em jogos multijogador. Remova o console da base e jogue com os controles Joy-Con encaixados. Este é o controle do Nintendo Switch, o Joy-Con! Os controles Joy-Con incluídos permitem total flexibilidade no jogo. Um ou dois controles, na vertical ou na horizontal, encaixados no console ou não.\n\nVersatilidade e diversão\nVocê pode jogar de diversas maneiras, dependendo do jogo. Passe um Joy-Con a um amigo para uma diversão instantânea com dois jogadores. Ou convide mais amigos com seus próprios controles para uma festa de jogos Experimente algo novo A vibração HD traz a você uma experiência física mais realista do jogo, enquanto a câmera de infravermelho possibilita novas experiências.\n\n','Nintendo Switch 32GB, 1x Joycon, Neon Azul/Vermelho - HAD S KABA2 BRA',4,0),(50,'\\n\n','R$ 329,99','\nControle para Nintendo Switch sem Fio Pro Controller Aumente o nível das suas sessões de jogo com o Controle Pro Controller. Inclui controle de movimento, vibração HD, funcionalidade amiibo pré-instalada e muito mais. Na cor cinza e sem fio, esse controle irá elevar seu jogo e facilitará suas ações no console. O Pro Controller vem para te dar mais uma opção de como jogar em seu Switch e te deixar a vontade para jogar como quiser.\n\n','Controle Nintendo Switch Pro Controller - HBCAFSSK1',4,0),(51,'\\n\n','R$ 49,99','\nControle SNES para PC Vinik, USB, Branco\n \nSNES no seu PC\nPara os fãs de jogos clássicos dos anos 90, como Super Mário World, Donkey Kong Country, entre outros jogos, a Vinik desenvolveu o controle SNES, que possui entrada USB própria para jogos no PC.\n\nBotões + Cabo\nCom design e acabamento semelhante ao controle tradicional o controle SNES tem botões de comando A, B / X, Y – SELECT e START, além dos direcionais em formato de cruz e os botões L e R. O controle também possui cabo de 1.8M com entrada USB.\n\nPlug and Play\nPara facilitar o uso, o controle possui a tecnologia “Plug and Play” (Conecte e Jogue), que dispensa a necessidade de instalação de softwares. É só conectar e jogar!\n','Controle SNES para PC Vinik, USB, Branco - 107482',4,0),(52,'\\n\n','R$ 389,99','\nVídeo Game Retro com 8514 jogos a melhor seleção do mercado, 27 plataformas/consoles mais conhecidos, basta ligar na tv e jogar Salve o jogo de onde parou e continue quando quiser. Enviamos para todo o Brasil.\n\n','Video Game Retro Playstation, Com 8500 Jogos + 2 Controles',4,0),(53,'\\n','R$ 782,90','\nDESCRIÇÃO Console Atari Flashback X, para matar a saudade de quem nunca se esqueceu do clássico dos anos 80. Entre neste mundo e divirta-se com seus jogos preferidos O console Atari Flashback X possui recursos modernos e impressionantes! Ele tem saída de vídeo de 720p de alta definição com filtro de linha de varredura, um sistema de menu intuitivo, funcionalidade de salvar e retornar o jogo e a capacidade de retroceder um jogo em andamento para se recuperar de um erro cometido. Dois joysticks com fio de aparência autêntica estão incluídos, permitindo ação de 1 ou 2 jogadores. Este novo design de mini console incrível tem sistema de computador de vídeo Atari 2600 original. Possui 110 jogos de vídeo game integrados. Esses jogos incluem sucessos como Adventure, Astereoids, Centipede, Chopper Command, Frogger, Missile Command, Pitfall!, Space Invaders, Yars Revenge e muito mais!\n','Video Game Atari Flashback X 110 Jogos',4,0);
